class Issue:
    def __init__(self, summary: str, description: str, project_id: str, attachments: list):
        self.summary = summary
        self.description = description
        self.project_id = project_id
        self.attachments = attachments

    def create_json(self) -> dict:
        json_ = {"project": {"id": self.project_id},
                 "summary": self.summary,
                 "description": self.description,
                 "attachments": [self.attachments]}

    def create_attachments_list(self):
        pass


class YouTrackApi:
    TOKEN = ''

    def get_profiles(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/users/?fields=id,login,name,email', params={})
        s.close()
        pp(h.json())

    def get_issues(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/issues?fields=id,summary,visibility,project(name)')
        pp(h.json())

    def create_an_issue(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        params = {"project": {"id": "0-2"},
                   "summary": "PHOTO HERE",
                   "description": "FIRST DESCRIPTION"}
        d = s.post('https://somedomain.youtrack.cloud/youtrack/api/issues?fields=id,name,attachments', json=params)
        files = [{"name": "test1", "base64Content": "data:image/png;base64,{}".format(
            base64.b64encode(open('logo.png', 'rb').read()).decode('utf-8'))},
                        {"name": "test2", "base64Content": "data:image/png;base64,{}".format(
                            base64.b64encode(open('ya.png', 'rb').read()).decode('utf-8'))}]
        h = s.post('https://somedomain.youtrack.cloud/youtrack/api/issues/{}/attachments?fields=id,name'.format(d.json()['id']), files=files)
        pp(h.json())

    def attach_image(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        params = {"name": "test", "base64Content": "data:image/png;base64,{}".format(base64.b64encode(open('logo.png', 'rb').read()).decode('utf-8'))}
        h = s.post('https://somedomain.youtrack.cloud/youtrack/api/issues/2-40/attachments?fields=id,name', json=params)
        pp(h.json())

    def get_projects(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/admin/projects?fields=id,name,shortName')
        pp(h.json())

    def get_agiles(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        s.post('https://somedomain.youtrack.cloud/youtrack/api/agiles/131-2/', json={'sprintsSettings': {"isExplicit": False}})
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/agiles/131-2?fields=sprintsSettings(isExplicit)')
        pp(h.json())

    def get_sprints(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/agiles/131-2/sprints/132-2?fields=issues(id),id,isDefault')
        pp(h.json())

    def update_sprint(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.post('https://somedomain.youtrack.cloud/youtrack/api/agiles/131-2/sprints/132-2/', json={"isDefault": True})

    def get_sprint_stg(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        h = s.get('https://somedomain.youtrack.cloud/youtrack/api/admin/SprintsSettings')
        pp(h)

    def get_commands(self):
        s = requests.Session()
        s.headers['authorization'] = 'Bearer ' + self.TOKEN
        di = {"query": "stage develop",
              "issues": [{"id": "2-40"}, {"id": "2-41"}]}
        h = s.post('https://somedomain.youtrack.cloud/api/commands', json=di)
        pp(h.json())


